import styled from "styled-components";

export const AllBtn = styled.div`
    width: 17vw;
    height: 7.5vh;
    background: #4484CE;
    border: none;
    display: flex;
    align-items: flex-start;
    justify-content: center;
    margin-right: 20px;
    color: #fff;
    padding: 0;
    padding-top: -10vh;
    font-size: 18px;
`;

export const Btn = {
    Linkedin_text: 'LinkedIn',
    Linkedin_link: '',
    Github_text: 'Github',
    Github_link: ''
}
